import { Link } from "react-router-dom";

export default function Menu(){
    return( <div class="menu">
        <nav  className="submenu">
            <Link to="./main">Претенденты</Link>
            <Link to="./favorites">Избранные</Link>
            <Link to="./rating">Рейтинг</Link>
        </nav>

    </div>)
}
